import React from 'react';
import { StyleSheet, Text, View, Image, FlatList } from 'react-native';
import {Card} from 'react-native-paper';

const  Home=()=>{
const data = [
    { name:"Vicente",position:"web dev"},
    { name:"Ricardo",position:"web dev"},
    { name:"Oscar",position:"web dev"},
    { name:"Fer",position:"web dev"},


] 
const renderList = ((item)=>{
    return(
        <Card style={styles.mycard}>
        <View style={styles.cardView}>
          <Image 
          style={{width:60,height:60, borderRadius:50/2}}     //rounded img
          source ={{uri:"https://play-lh.googleusercontent.com/a-/AOh14GjGOVc8jPEdbWsyPQcy8N2vVMQrr8QT97f16bA"}}
          />
             <View style={{marginLeft:10}}>
                 <Text style={styles.text}>{item.name}</Text>  
                 <Text style={styles.text}>{item.position}</Text>  
             </View>
         </View>
        
     </Card>
    )
})
    return(
        <View>
            <FlatList
             data={data}
             renderItem={(item)=>{
               return renderList(item)
            }}
            keyExtractor={item=>item.id}
            />
        </View>
 
)
}

const styles = StyleSheet.create({
    mycard:{
        margin:5,
        padding:5,
        
    },
    cardView:{
       flexDirection:"row",
        padding:6
    },
    text:{
        fontSize:12,
    }
    
})
export {Home}
